class LandingPage extends Component {
  render() {
    return (
      <div>
        <Container>
          <Row>
            <Col md={5} sm={10} className="section">
              TESTTT
            </Col>
            <Col md={1} sm={0}></Col>
            <Col md={5} sm={10} className="section">
              xs=6 md=4
            </Col>
          </Row>
        </Container>
      </div>
    );
  }
}

export default LandingPage;
